DDL_my.sql 变化情况如下: diff --git a/DDL_my.sql b/DDL_my.sql
index b3a89ca..3b1055f 100755
--- a/DDL_my.sql
+++ b/DDL_my.sql
@@ -12,7 +12,7 @@ */ -- 创建 sales 数据库（在MySQL中, schema与database是同义词）
-CREATE DATABASE IF NOT EXISTS sales;
+CREATE DATABASE IF NOT EXISTS sales CHARACTER SET GBK; -- 切换到 sales 数据库（在MySQL中, 使用USE来切换数据库） USE sales;
@@ -25,7 +25,7 @@ CREATE TABLE Adminaddrs( /*行政区划地址 administration address*/ parentid INTEGER REFERENCES Adminaddrs(addrid), /*父地址编码*/ /*location GEOMETRY, */ /*经度纬度合一起的 GIS数据, 可能需要PostGis扩展插件支持, 可以用来计算就近仓库发货 */ currlevel INTEGER /*当前层级 current level*/
-);
+) DEFAULT CHARSET=GBK; -- 创建 Categories 表 CREATE TABLE Categories(/*商品分类*/
@@ -34,7 +34,7 @@ CREATE TABLE Categories(/*商品分类*/ catgname VARCHAR(128), /*分类名称*/ parentid INTEGER REFERENCES Categories(catgid), /*父类编码*/ currlevel INTEGER /*当前层级 current level*/
-);
+) DEFAULT CHARSET=GBK; -- 创建 Shopstores 表 /* Example: https://mall.jd.com/shopLevel-952805.html */
@@ -46,7 +46,7 @@ CREATE TABLE Shopstores(/*店铺*/ delygrading DECIMAL(5,2), /*物流评分 delivery grading*/ servgrading DECIMAL(5,2), /*服务评分service grading*/ comprgrading DECIMAL(5,2) /*综合评分 comprehensive grading*/
-);
+) DEFAULT CHARSET=GBK; -- 创建 Goods 表 CREATE TABLE Goods(/*商品*/
@@ -66,7 +66,7 @@ CREATE TABLE Goods(/*商品*/ size POLYGON, /* 商品尺寸, 长 宽 高 */ /*image BINARY, */ /* 商品图片 */ instmanual TEXT /* 使用说明 instruction manual */
-);
+) DEFAULT CHARSET=GBK; -- 创建 Supply 表 CREATE TABLE Supply(/*店铺商品 供应*/
@@ -79,7 +79,7 @@ CREATE TABLE Supply(/*店铺商品 供应*/ url VARCHAR(512), /* 商品网址 */ homepage LONGTEXT, /* 商品网页转换而来的XML数据, 方便搜索, 使用LONGTEXT代替XML, 因为MySQL 8.0不再支持XML类型 */ PRIMARY KEY(shopid, goodid)
-);
+) DEFAULT CHARSET=GBK; /*CREATE TYPE GENDERENUM AS ENUM(1, 2, 9); */ /*性别, 国家编码 1 男, 2 女, 9 未知*/ @@ -96,7 +96,7 @@ CREATE TABLE Customers(/*顾客*/ mi VARCHAR(16) NULL, /*月收入（是一个范围值）, monthly income, 使用DECIMAL代替INT8RANGE, 因为MySQL不支持INT8RANGE类型*/ ebg CHAR(4) CHECK (ebg IN ('小学', '初中', '高中', '中专', '大专', '本科', '硕士', '博士', '其他')), /*教育程度, 有国家编码, 为简便起见, 直接使用汉字*/ prof CHAR(50) /*所在行业 profession, 有国家编码, 为简便起见, 直接使用行业名称*/
-);
+) DEFAULT CHARSET=GBK; -- 创建 Comments 表 CREATE TABLE Comments(/*商品评论*/
@@ -110,7 +110,7 @@ CREATE TABLE Comments(/*商品评论*/ CHECK ((feeling = '好评' AND stars >= 4) OR (feeling = '中评' AND (stars = 3 OR stars = 2)) OR (feeling = '差评' AND stars = 1))
-);
+) DEFAULT CHARSET=GBK; -- 创建 Orders 表 CREATE TABLE Orders(/*订单*/
@@ -140,7 +140,7 @@ CREATE TABLE Orders(/*订单*/ mot CHAR(4), /*运输方式 Mode of Transportation, 航空, 铁路、公路、水路等, 运输方式和发货收货距离 决定 预计到达日期 */ doe DATE, /*预计到达日期 date of estimation*/ doa DATE /*送达日期 date of arrival */
-);
+) DEFAULT CHARSET=GBK; -- 创建 Lineitems 表 CREATE TABLE Lineitems(/*订单明细*/
@@ -151,4 +151,4 @@ CREATE TABLE Lineitems(/*订单明细*/ saleamt INTEGER, /*销售数量*/ PRIMARY KEY (ordid, shopid, goodid), FOREIGN KEY (shopid, goodid) REFERENCES Supply(shopid, goodid)
-);
+) DEFAULT CHARSET=GBK;
